if mibBuilder.loadTexts: nbsCmmcSysFirmwareURL.setDescription("Remote URL in the form: scheme://[username[:password]@]IP[:port][/path/]filename to use for the remote entry in FirmwareTable. When set, the remote URL will be retrieved and checked for compatability. If it is a valid firmware file, a row in FirmwareTable will be instantiated to represent this file. The corresponding FirmwareFilename will be set to the URL, and FirmwareType set accordingly. The file may or not be cached locally if this row is chosen for a Chassis or SlotFirmwareLoad. If the user has changed the remote file after FirmwareURL is set, but before a Chassis or SlotFirmwareLoad is initiated, the results are undefined. If the remote file has changed, setting this object again will 'refresh' its FirmwareTable entry. If a zero length string is set, the corresponding FirmwareType in the FirmwareTable row will be changed to 'deleted', and any local cache of the file deleted. If an invalid URL is set, or the remote file is invalid or does not exist, the corresponding FirmwareTable row will be changed to 'deleted'. If port is omitted, an appropriate port according to the scheme will be automatically selected Note that only numeric IPs are supported; there is no resolver. If a remote file fetch is in progress, or any Chassis or SlotFirmwareLoad involving a remote URL is in progress, sets to this object will be rejected. This object is not stored in the running configuration. It is an 'impulse' object.")
