if mibBuilder.loadTexts: nbsCmmcPortNominalBitRate.setDescription("This NominalBitRate variable exists for modules which support configurable speeds that may not be listed in PortSpeed. Here can be specified the raw bit rate desired, measured in decimal Mbps. The Agent may use exactly that rate, or may substitute it with a compatible rate within an appropriate range of speeds. If the Agent receives a request for a bitrate it cannot support, it should return the SNMP errorstatus badValue(3). For ports whose speed is unknown or not configurable, the Agent should report this value as -1. The reserved value 0 specifies that no speed is configured, and any clocking is bypassed. The following values are associated with specific protocols: 44 - DS3 51 - OC-1 77 - Telco bus 125 - Fast Ethernet (100 Mbps) 126 - FDDI 155 - OC-3 200 - ESCON 270 - SDI 270Mbps 540 - SDI 540Mbps 622 - OC-12 1063 - 1 Gig FibreChannel 1244 - OC-24 1250 - Gigabit Ethernet 1485 - HDTV 2125 - 2 Gig FibreChannel 2450 - OC-48 2500 - Infiniband 2666 - OC-48+FEC 9953 - 10 Gig Ethernet/WAN 10312 - 10 Gig Ethernet/LAN 10625 - 10 Gig FibreChannel For ports that support ProtoAdmin 'userDefined', writing this object will automatically set the ProtoAdmin to 'userDefined'.")
