nbsCmmcPortLinkMatch = MibTableColumn((1, 3, 6, 1, 4, 1, 629, 200, 8, 1, 1, 56), Integer32().subtype(subtypeSpec=ConstraintsUnion(SingleValueConstraint(1, 2, 3))).clone(namedValues=NamedValues(("notSupported", 1), ("disabled", 2), ("enabled", 3))).clone('enabled')).setMaxAccess("readwrite")
if mibBuilder.loadTexts: nbsCmmcPortLinkMatch.setStatus('current')
if mibBuilder.loadTexts: nbsCmmcPortLinkMatch.setDescription('Some converter ports that are capable of autonegotiation (ANEG) may sometimes be between two end ports that would like to autonegotiate with each other. The Agent can ensure that both ports in the converter/circuit settle on the same autonegotiated settings. This feature is called LinkMatch. ANEG with LinkMatch can sometimes be a lengthy process. In order to streamline the ANEG process, users may manually configure the parameters that supporting ports will advertise during their independent autonegotiations. This involves two steps - first to change the nbsCmmcPortAutoNegAd object to reflect the outcome desired, then to set this nbsCmmcPortLinkMatch object to the value disabled(2). The default value for this object is enabled(3). Ports that do not support this feature should return the value notSupported(1).')
nbsCmmcPortMDIPinoutAdmin = MibTableColumn((1, 3, 6, 1, 4, 1, 629, 200, 8, 1, 1, 57), Integer32().subtype(subtypeSpec=ConstraintsUnion(SingleValueConstraint(1, 2, 3, 4))).clone(namedValues=NamedValues(("notSupported", 1), ("mdi", 2), ("mdix", 3), ("autoSense", 4))).clone('autoSense')).setMaxAccess("readwrite")
if mibBuilder.loadTexts: nbsCmmcPortMDIPinoutAdmin.setStatus('current')
if mibBuilder.loadTexts: nbsCmmcPortMDIPinoutAdmin.setDescription('Connecting twisted-pair ethernet ports originally required care in choosing either straight or crossover cables. Later, many ethernet ports added the feature that they could be configured to accept either cable pinout. Some ports are even smart enough to detect, or autosense, the pinout they should use. This Administrative object allows users to request the port adopt a specific pinout, or to have the port autosense it. The value notSupported(1) indicates that this port cannot dynamically alter its pinout through this object. The value mdi(2) is used to connect with a straight cable to mdix ports such as those found on hubs, switches and routers. The value mdix(3) is used to connect with a straight cable to mdi ports such as those found on workstations. The value autoSense(4) indicates this port should automatically detect and change to the necessary pinout. This object has a corresponding Operational value which reports the actual pinout state. In certain situations, the Operational value might differ from the Administrative.')
nbsCmmcPortMDIPinoutOper = MibTableColumn((1, 3, 6, 1, 4, 1, 629, 200, 8, 1, 1, 58), Integer32().subtype(subtypeSpec=ConstraintsUnion(SingleValueConstraint(1, 2, 3))).clone(namedValues=NamedValues(("notSupported", 1), ("mdi", 2), ("mdix", 3))).clone('mdi')).setMaxAccess("readonly")
if mibBuilder.loadTexts: nbsCmmcPortMDIPinoutOper.setStatus('current')
if mibBuilder.loadTexts: nbsCmmcPortMDIPinoutOper.setDescription('This object reports the actual pinout state of an ethernet port.')
nbsCmmcPortFCRecvAdmin = MibTableColumn((1, 3, 6, 1, 4, 1, 629, 200, 8, 1, 1, 59), Integer32().subtype(subtypeSpec=ConstraintsUnion(SingleValueConstraint(1, 2, 3, 4))).clone(namedValues=NamedValues(("notSupported", 1), ("drop", 2), ("comply", 3), ("passThru", 4))).clone('comply')).setMaxAccess("readwrite")
if mibBuilder.loadTexts: nbsCmmcPortFCRecvAdmin.setStatus('current')
if mibBuilder.loadTexts: nbsCmmcPortFCRecvAdmin.setDescription('This object allows user to specify what this port should do if it receives a flow control request. This object is ignored when nbsCmmcPortFlowControl is disabled. If this object reports notSupported(1), no changes to this object are allowed. Setting this object to drop(2) indicates that this port should ignore requests to control its flow. Setting this object to comply(3) means this port should grant flow control requests from the connected port, and buffer up traffic while the other side catches up. If this object is set to passthru(4), the port will not comply with the request, but will relay it along to the next port. The corresponding nbsCmmcPortFCRecvOper object indicates the setting that is actually in effect.')
nbsCmmcPortFCRecvOper = MibTableColumn((1, 3, 6, 1, 4, 1, 629, 200, 8, 1, 1, 60), Integer32().subtype(subtypeSpec=ConstraintsUnion(SingleValueConstraint(1, 2, 3, 4))).clone(namedValues=NamedValues(("notSupported", 1), ("drop", 2), ("comply", 3), ("passThru", 4))).clone('comply')).setMaxAccess("readonly")
if mibBuilder.loadTexts: nbsCmmcPortFCRecvOper.setStatus('current')
if mibBuilder.loadTexts: nbsCmmcPortFCRecvOper.setDescription('This object indicates what this port will do with flow control requests it receives.')
nbsCmmcPortFCSendAdmin = MibTableColumn((1, 3, 6, 1, 4, 1, 629, 200, 8, 1, 1, 61), Integer32().subtype(subtypeSpec=ConstraintsUnion(SingleValueConstraint(1, 2, 3))).clone(namedValues=NamedValues(("notSupported", 1), ("disabled", 2), ("enabled", 3))).clone('enabled')).setMaxAccess("readwrite")
