if mibBuilder.loadTexts: nbsCmmcPortFCSendAdmin.setDescription('This object specifies whether this port will send flow control requests when its in danger of dropping incoming packets. This object is ignored when nbsCmmcPortFlowControl is disabled. Setting this object to enabled(3) means this port may send flow control requests to the other port. Setting this object to disabled(2) indicates that this port should drop packets instead of sending flow control requests. If this object is set to notSupported(1), this object cannot be changed for this port. The corresponding nbsCmmcPortFCSendOper object indicates the setting that is actually in effect.')
nbsCmmcPortFCSendOper = MibTableColumn((1, 3, 6, 1, 4, 1, 629, 200, 8, 1, 1, 62), Integer32().subtype(subtypeSpec=ConstraintsUnion(SingleValueConstraint(1, 2, 3))).clone(namedValues=NamedValues(("notSupported", 1), ("disabled", 2), ("enabled", 3))).clone('enabled')).setMaxAccess("readonly")
if mibBuilder.loadTexts: nbsCmmcPortFCSendOper.setStatus('current')
