nbsCmmcPortAutoNegWait = MibTableColumn((1, 3, 6, 1, 4, 1, 629, 200, 8, 1, 1, 63), Integer32().subtype(subtypeSpec=ValueRangeConstraint(0, 254))).setMaxAccess("readwrite")
