if mibBuilder.loadTexts: nbsCmmcPortMappingType.setDescription('Administrative crossbar mapping restrictions for this port. Non-crossbar ports must be reported as notSupported(1). If notSupported, any SET attempts will be rejected. Users may not set this object to notSupported(1). Users may mark the port as unavailable(2). If unavailable, the Agent will reject any attempts to map from or to this port. By default, each crossbar port is open(3). Open ports have no mapping restrictions. Ports that are set to source(4) may be used as the input (nbsCmmcPortZoneIfIndexAdmin) port by any other crossbar port. Their own input port may only be mapped to ports whose nbsCmmcPortMappingType is sourceHelper(6). Ports that are set to destination(5) may set their own input (nbsCmmcPortZoneIfIndexAdmin) port to any other crossbar port. They may not be used as the input port for other ports. A sourceHelper(6) port is used to provide whatever sort of link indication is needed by external traffic sources that are connected to a source(4) port. Ports set to interChasLink(7) are physically cabled to another crossbar port in a separate chassis. That connection should be entered by the user in the network topology objects nbsCmmcPortRMChassis, nbsCmmcPortRMSlot, and nbsCmmcPortRMPort for both those connected ports.')
